const items = [];
const doScrapeFallback = true; // set false to skip scraping fallback

const today = () => new Date().toISOString().split('T')[0];

function normalizeSiteUrl(u){
  if(!u || typeof u !== 'string') return '';
  u = u.trim();
  // strip trackers/params
  u = u.replace(/\?.*$/,'').replace(/\/$/,'');
  if(!/^https?:\/\//i && /^[\w.-]+\.[a-z]{2,}$/i.test(u)) u = 'https://' + u;
  return u;
}

function normalizeEmail(e){
  if(!e) return '';
  e = e.toLowerCase().trim();
  // reject placeholders
  const bad = ['your@email.com','user@example.com','user@example.com','user@example.com','user@example.com','user@example.com'];
  if(bad.includes(e)) return '';
  if(!/[A-Za-z0-9._%+-]+@[A-Za-z0-9.-]+\.[A-Za-z]{2,}/.test(e)) return '';
  return e;
}

function normalizePhone(p){
  if(!p) return '';
  // keep + then digits
  const plus = p.trim().startsWith('+') ? '+' : '';
  const digits = p.replace(/[^\d]/g,'');
  if(digits.length < 7) return '';
  if(/^0+$/.test(digits)) return '';
  if(/^(\d)\1{5,}$/.test(digits)) return '';
  return plus + digits;
}

function findEmailsInText(text){
  if(!text) return [];
  const r = text.match(/[A-Za-z0-9._%+-]+@[A-Za-z0-9.-]+\.[A-Za-z]{2,}/g) || [];
  return Array.from(new Set(r.map(e => normalizeEmail(e)).filter(Boolean)));
}

function findPhonesInText(text){
  if(!text) return [];
  const r = text.match(/(?:\+?\d{1,3}[-.\s]?)?(?:\(?\d{2,4}\)?[-.\s]?)?(?:\d{2,4}[-.\s]?){1,4}\d{2,4}/g) || [];
  const norm = Array.from(new Set(r.map(p => normalizePhone(p)).filter(Boolean)));
  return norm;
}

function stripHtml(html){
  if(!html) return '';
  return html.replace(/<script[\s\S]*?>[\s\S]*?<\/script>/gi,' ')
             .replace(/<style[\s\S]*?>[\s\S]*?<\/style>/gi,' ')
             .replace(/<\/?[^>]+(>|$)/g,' ')
             .replace(/\s{2,}/g,' ').trim();
}

// Heuristic: prefer email matching website domain
function scoreEmailAgainstSite(email, site){
  if(!email || !site) return 0;
  try {
    const ed = email.split('@').pop();
    const sd = (new URL(normalizeSiteUrl(site))).hostname.replace(/^www\./i,'');
    if(ed && sd && ed.includes(sd)) return 5;
  } catch(e){}
  return 1;
}

for(const it of $input.all()){
  const j = it.json || {};

  // Detect if the item is from serpapi local_results place
  const isLocalPlace = !!(j.phone || (j.links && j.links.website) || j.title);

  // Candidate fields (prefer structured SerpAPI fields)
  let business_name = (j.title || j.name || j.business_name || j.place_name || j.company) || '';
  let website = (j.links && (j.links.website || j.links.website)) || j.website || j.displayed_link || j.link || '';
  let snippet = (j.snippet || j.description || j.snippet_highlighted_words?.join(' ') || j.rich_snippet?.top?.extensions?.join(' ') || '') || '';
  let email = '';
  let phone = '';

  // If SerpAPI local_results has explicit phone or website
  if(j.phone) phone = normalizePhone(j.phone);
  if(j.links && j.links.website) website = j.links.website;

  // If structured contact fields exist
  if(j.email) email = normalizeEmail(j.email);
  if(j.contact_email) email = normalizeEmail(j.contact_email);

  // If the item includes a 'snippet' or 'description', try to extract emails/phones from it
  const candidateText = [
    JSON.stringify(j),
    j.snippet || '',
    j.description || '',
    j.rich_snippet && JSON.stringify(j.rich_snippet) || ''
  ].join(' ');

  if(!email){
    const emailsFound = findEmailsInText(candidateText);
    if(emailsFound.length) {
      // prefer email matching website domain
      emailsFound.sort((a,b) => scoreEmailAgainstSite(b,website) - scoreEmailAgainstSite(a,website));
      email = emailsFound[0] || '';
    }
  }

  if(!phone){
    const phonesFound = findPhonesInText(candidateText);
    phone = phonesFound[0] || '';
  }

  // If still missing and Scrape fallback allowed, try to parse item.json.data (if Scrape Website ran before)
  // Note: when this node runs BEFORE Scrape Website, item.json.data likely not present.
  if(doScrapeFallback && (!email || !phone) && j.data && typeof j.data === 'string'){
    const html = j.data;
    if(!email){
      const e2 = findEmailsInText(html);
      if(e2.length) email = e2[0];
    }
    if(!phone){
      const p2 = findPhonesInText(html);
      if(p2.length) phone = p2[0];
    }
  }

  // Final normalization
  website = normalizeSiteUrl(website);
  business_name = (business_name && business_name.toString().trim()) || '';
  snippet = stripHtml(snippet).slice(0,1000);

  // If both business_name and website empty, try to derive name from displayed_link or domain
  if(!business_name && website){
    try {
      business_name = (new URL(website)).hostname.replace(/^www\./,'');
    } catch(e){}
  }

  // Decide if useful (avoid placeholder-only results)
  const useful = business_name.length > 1 || website.length > 5 || email.length > 4 || phone.replace(/[^\d]/g,'').length >= 7 || snippet.length > 20;
  if(!useful) continue;

  items.push({
    json: {
      business_name: business_name || 'N/A',
      website: website || 'N/A',
      snippet: snippet || 'N/A',
      email: email || 'Not found',
      phone: phone || 'Not found',
      position: j.position || j.rank || 'N/A',
      scraped_date: today()
    }
  });
}

return items;
